import React from 'react';
import Aux from '../../../Hoc/Aux/Aux';

const Receipt = (props) => (
    <Aux>
        <div className="ReceiptCardContainer">
            <div className="Shop">
                Shop: {props.location}
            </div>
            <div className="Item">
                Item: {props.item}
            </div>
            <div className="Date">
                Date: {props.date}
            </div>
            <div className="Price">
                Price: {props.price}
            </div>
        </div>
    </Aux>
    );

export default Receipt;
